                }
                case RecordTypeInts.SNDX:
                {
                    _DataLocation = new RangeInt32((stream.Position - offset), finalPos);
                    _DataType = type;
                    return (int)Sound_FieldIndex.Data;
                }
                default:
                    return base.FillRecordType(
                        stream: stream,
                        finalPos: finalPos,
